  false,\n\t\"url\": null,\n\t\"notes\": \"<p>This public use file combines registration
  data compiled from two federal programs that are on-going since February 2009 u2013
  the Centers for Medicare &amp; Medicaid Services (CMS) Electronic Health Record
  (EHR) Incentive Programs and the ONC Health IT Regional Extension Centers (REC)
  Program u2013 which collectively assist nearly 400,000 health care providers in
  their process to adopt EHRs and demonstrate the meaningful use of health IT.</p>n<p>This
  file enables tracking trends in the adoption of electronic health record (EHR) technologies
  by EHR vendor and by health care provider type (i.e., for professionals practicing
  in office-based settings and non-federal acute-care hospitals in the United States).</p>n\",\n\t\"license_title\":
